import React, { useState } from 'react';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

const EditableTable = () => {
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [email, setEmail] = useState('');
  const [data, setData] = useState([]);
  const [editingRows, setEditingRows] = useState({});

  const addRow = () => {
    if (!name || !age || !email) {
      alert("Please fill in all fields.");
      return;
    }

    setData((prevData) => [
      ...prevData,
      { name, age, email }
    ]);

    // Clear input fields after adding data to the table
    setName('');
    setAge('');
    setEmail('');
  };

  const debounce = (fn, delay) => {
    let timer;
    return function (...args) {
      clearTimeout(timer);
      timer = setTimeout(() => fn.apply(this, args), delay);
    };
  };

  const onRowEditInit = (event) => {
    const rowIndex = event.index;
    let editingRowsCopy = { ...editingRows };
    editingRowsCopy[rowIndex] = true;
    setEditingRows(editingRowsCopy);
  };

  const onRowEditSave = (event) => {
    const rowIndex = event.index;
    let updatedData = [...data];
    updatedData[rowIndex] = editingRows[rowIndex];
    setData(updatedData);
    setEditingRows({});
  };

  const onRowEditCancel = (event) => {
    setEditingRows({});
  };

  const onEditorValueChange = (props, value) => {
    const rowIndex = props.rowIndex;
    const field = props.field;
    setEditingRows((prevEditingRows) => {
      const updatedRow = { ...prevEditingRows, [rowIndex]: { ...prevEditingRows[rowIndex], [field]: value } };
      return updatedRow;
    });
  };

  const saveButtonTemplate = (rowData, column) => {
    const rowIndex = column.rowIndex;
    if (editingRows.hasOwnProperty(rowIndex)) {
      return (
        <div>
          <Button icon="pi pi-check" className="p-button-rounded p-button-success p-button-outlined" onClick={() => onRowEditSave({ index: rowIndex })} />
        </div>
      );
    } else {
      return (
        <div>
          <Button icon="pi pi-pencil" className="p-button-rounded p-button-warning p-button-outlined" onClick={() => onRowEditInit({ index: rowIndex })} />
        </div>
      );
    }
  };

  return (
    <div>
      <h2>Editable Table</h2>
      <form>
        <label htmlFor="name">Name:</label>
        <InputText id="name" value={name} onChange={(e) => setName(e.target.value)} required />

        <label htmlFor="age">Age:</label>
        <InputText id="age" value={age} onChange={(e) => setAge(e.target.value)} required />

        <label htmlFor="email">Email:</label>
        <InputText id="email" value={email} onChange={(e) => setEmail(e.target.value)} required />

        <Button type="button" label="Add" onClick={addRow} className="p-button-primary" />
      </form>

      <DataTable
        value={data}
        editMode="row"
        dataKey="email"
        onRowEditCancel={onRowEditCancel}
      >
        <Column field="name" header="Name" editor={(props) => editingRows.hasOwnProperty(props.rowIndex) ? <InputText type="text" value={editingRows[props.rowIndex]['name']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['name']} />
        <Column field="age" header="Age" editor={(props) => editingRows.hasOwnProperty(props.rowIndex) ? <InputText type="text" value={editingRows[props.rowIndex]['age']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['age']} />
        <Column field="email" header="Email" editor={(props) => editingRows.hasOwnProperty(props.rowIndex) ? <InputText type="text" value={editingRows[props.rowIndex]['email']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['email']} />
        <Column body={saveButtonTemplate} style={{ width: '70px', textAlign: 'center' }} />
      </DataTable>
    </div>
  );
};

export default EditableTable;
